import React from 'react';

class Content2 extends React.Component {
  render() {
    const filmFans=this.props.filmFans;
    return (
      React.createElement('div', {className:'App-content', style: {backgroundColor:'#339933', padding:'2em'}},
        React.createElement('h2',{style: {color:'#000000'}},'List of movies and people who like them:'),
        React.createElement('ul', {},
          filmFans.map(film => {
        	const fans = Array.from(film.fans);
            return(
              React.createElement( 'li', {},
                React.createElement('h4', {style: {color:'#000000', padding:'0.5em'}}, `${film.title}`),
                React.createElement('h4', {style: {color:'#000000', padding:'0.5em'}}, (fans.length > 0) ? `Liked by: ${fans} (${fans.length})` : 'Liked by: no-one'),
                React.createElement('ol', {}, 'Ordered List',                     
                  fans.map(afan => {
                    const someLength = afan.length;
                    return(
                      React.createElement('li', {}, 'List Item',
                        React.createElement('h4', {style: {color:'#000000', padding:'0.5em'}}, `Unsigned List: ${someLength}`)
                      )
                    )
                  })
                )
              )
            )
          })
        )
      )
    )
  }
}

export default Content2;
